import './App.css';
import Navbar from "./components/navbar/Navbar";

function App() {

    const links = [
        { label: 'Home', href: '#' },
        { label: 'About', href: '#' },
        { label: 'Contact', href: '#' },
    ];

  return (
    <div className="App">
        <Navbar title="School Management System" links={links} />
    </div>
  );
}

export default App;
